/* setup the PS2 interrupts in the FPGA */
void config_PS2() {
    volatile int * ps2_ptr = (int *) 0xFF200100; // pushbutton KEY base address
    *(ps2_ptr+1) = 0x1;
}
/* Below:
* 1. defines exception vectors for the A9 processor
* 2. provides code that sets the IRQ mode stack, and that dis/enables
* interrupts
* 3. provides code that initializes the generic interrupt controller
*/
void PS2_ISR(void);
void config_interrupt(int, int);
// Define the IRQ exception handler
void __attribute__((interrupt)) __cs3_isr_irq(void) {
    // Read the ICCIAR from the CPU Interface in the GIC
    int interrupt_ID = *((int *)0xFFFEC10C);
    if (interrupt_ID == 79) // check if interrupt is from the KEYs
        PS2_ISR();
    else
        while (1); // if unexpected, then stay here
    // Write to the End of Interrupt Register (ICCEOIR)
    *((int *)0xFFFEC110) = interrupt_ID;
}
// Define the remaining exception handlers
void __attribute__((interrupt)) __cs3_reset(void) {
    while (1);
}
void __attribute__((interrupt)) __cs3_isr_undef(void) {
    while (1);
}
void __attribute__((interrupt)) __cs3_isr_swi(void) {
    while (1);
}
void __attribute__((interrupt)) __cs3_isr_pabort(void) {
    while (1);
}
void __attribute__((interrupt)) __cs3_isr_dabort(void) {
    while (1);
}
void __attribute__((interrupt)) __cs3_isr_fiq(void) {
    while (1);
}
/*
* Turn off interrupts in the ARM processor
*/
void disable_A9_interrupts(void) {
    int status = 0b11010011;
    asm("msr cpsr, %[ps]" : : [ps] "r"(status));
}
/*
* Initialize the banked stack pointer register for IRQ mode
*/
void set_A9_IRQ_stack(void) {
    int stack, mode;
    stack = 0xFFFFFFFF - 7; // top of A9 onchip memory, aligned to 8 bytes
    /* change processor to IRQ mode with interrupts disabled */
    mode = 0b11010010;
    asm("msr cpsr, %[ps]" : : [ps] "r"(mode));
    /* set banked stack pointer */
    asm("mov sp, %[ps]" : : [ps] "r"(stack));
    /* go back to SVC mode before executing subroutine return! */
    mode = 0b11010011;
    asm("msr cpsr, %[ps]" : : [ps] "r"(mode));
}
/*
* Turn on interrupts in the ARM processor
*/
void enable_A9_interrupts(void) {
    int status = 0b01010011;
    asm("msr cpsr, %[ps]" : : [ps] "r"(status));
}
/*
* Configure the Generic Interrupt Controller (GIC)
*/
void config_GIC(void) {
    config_interrupt (79, 1); // configure the PS2 interrupt (79)
    // Set Interrupt Priority Mask Register (ICCPMR). Enable interrupts of all
    // priorities
    *((int *) 0xFFFEC104) = 0xFFFF;
    // Set CPU Interface Control Register (ICCICR). Enable signaling of
    // interrupts
    *((int *) 0xFFFEC100) = 1;
    // Configure the Distributor Control Register (ICDDCR) to send pending
    // interrupts to CPUs
    *((int *) 0xFFFED000) = 1;
}
/*
* Configure Set Enable Registers (ICDISERn) and Interrupt Processor Target
* Registers (ICDIPTRn). The default (reset) values are used for other registers
* in the GIC.
*/
void config_interrupt(int N, int CPU_target) {
    int reg_offset, index, value, address;
    /* Configure the Interrupt Set-Enable Registers (ICDISERn).
    * reg_offset = (integer_div(N / 32) * 4
    * value = 1 << (N mod 32) */
    reg_offset = (N >> 3) & 0xFFFFFFFC;
    index = N & 0x1F;
    value = 0x1 << index;
    address = 0xFFFED100 + reg_offset;
    /* Now that we know the register address and value, set the appropriate bit */
    *(int *)address |= value;
    /* Configure the Interrupt Processor Targets Register (ICDIPTRn)
    * reg_offset = integer_div(N / 4) * 4
    * index = N mod 4 */
    reg_offset = (N & 0xFFFFFFFC);
    index = N & 0x3;
    address = 0xFFFED800 + reg_offset + index;
    /* Now that we know the register address and value, write to (only) the
    * appropriate byte */
    *(char *)address = (char)CPU_target;
}

/********************************************************************
* PS2 - Interrupt Service Routine
*
* This routine reads make and break codes when inputted. It then changes 
* global variables byte1-3 for them to be displayed on the hex display
*******************************************************************/
void PS2_ISR(void) {
    volatile int * PS2_ptr = (int *)PS2_BASE;
	
	int PS2_data, RVALID;
    PS2_data = *(PS2_ptr); // read the Data register in the PS/2 port
    RVALID = PS2_data & 0x8000; // extract the RVALID field
    if (RVALID) {
        /* shift the next data byte into the display */
        byte1 = byte2;
        byte2 = byte3;
        byte3 = PS2_data & 0xFF;
        //HEX_PS2(byte1, byte2, byte3);
        if ((byte2 == (char)0xAA) && (byte3 == (char)0x00))
        // mouse inserted; initialize sending of data
            *(PS2_ptr) = 0xF4;

        if (byte2 == 0xF0) {
            if (byte3 == 0x1C)
            holdLeftRED = false;
            if (byte3 == 0x23)
            holdRightRED = false;
            if (byte3 == 0x6B)
            holdLeftBLUE = false;
            if (byte3 == 0x74)
            holdRightBLUE = false;
        }
        else {
            if (byte3 == 0x1C)
            holdLeftRED = true;
            if (byte3 == 0x23)
            holdRightRED = true;
            if (byte3 == 0x6B)
            holdLeftBLUE = true;
            if (byte3 == 0x74)
            holdRightBLUE = true;
            if (byte3 == 0x1D) {
                if (!jumpRED && dyRED == 0) {
                    dyRED = JUMP_UP;
                    countJumpFrameRED = 0;
                    jumpRED = true;
                }
            }
            if (byte3 == 0x75) {
                if (!jumpBLUE && dyBLUE == 0) {
                    dyBLUE = JUMP_UP;
                    countJumpFrameBLUE = 0;
                    jumpBLUE = true;
                }
            }
        }
        if(die)
        {
            if(byte3 == 0x2D)
                restartPress = true;
        }
    }
    return;
}

// display make break codes on hex display
void HEX_PS2(char b1, char b2, char b3) {
	volatile int * HEX3_HEX0_ptr = (int *)HEX3_HEX0_BASE;
	volatile int * HEX5_HEX4_ptr = (int *)HEX5_HEX4_BASE;
	/* SEVEN_SEGMENT_DECODE_TABLE gives the on/off settings for all segments in
	* a single 7-seg display in the DE1-SoC Computer, for the hex digits 0 - F
	*/
	unsigned char seven_seg_decode_table[] = {
	0x3F, 0x06, 0x5B, 0x4F, 0x66, 0x6D, 0x7D, 0x07,
	0x7F, 0x67, 0x77, 0x7C, 0x39, 0x5E, 0x79, 0x71};
	unsigned char hex_segs[] = {0, 0, 0, 0, 0, 0, 0, 0};
	unsigned int shift_buffer, nibble;
	unsigned char code;
	int i;
	shift_buffer = (b1 << 16) | (b2 << 8) | b3;
	for (i = 0; i < 6; ++i) {
		nibble = shift_buffer & 0x0000000F; // character is in rightmost nibble
		code = seven_seg_decode_table[nibble];
		hex_segs[i] = code;
		shift_buffer = shift_buffer >> 4;
	}
	/* drive the hex displays */
	*(HEX3_HEX0_ptr) = *(int *)(hex_segs);
	*(HEX5_HEX4_ptr) = *(int *)(hex_segs + 4);
}

// cursed function
void changePlayerPosition(char b2, char b3) {
    // variables for storing previous positions
    int temp_x = 0;
	int temp_y = 0;

    // edge cases if players hit boundary of vga
    // technically this can't happen due to the boundaries of the background but you never know
    if (xRED+dxRED > 320 - 7 || xRED+dxRED < 0) {
        dxRED = STILL;
    }
    if (yRED+dyRED > 240 -  7 || yRED+dyRED < 0) {
		dyRED = STILL;
	}
    if (xBLUE+dxBLUE > 320 - 7 || xBLUE+dxBLUE < 0) {
        dxBLUE = STILL;
    }
	if (yBLUE+dyBLUE > 240 - 7 || yBLUE+dyBLUE < 0) {
		dyBLUE = STILL;
	}
    
    // change player position
    xRED += dxRED;
    yRED += dyRED;
    xBLUE += dxBLUE;
    yBLUE += dyBLUE;

    // find and erase previous square positions
    // red
    prevXPositionsRED[prev] = xRED;
    prevYPositionsRED[prev] = yRED;
    temp_x = prevXPositionsRED[(prev + 1)%3];
    temp_y = prevYPositionsRED[(prev + 1)%3];
    //draw_box(temp_x, temp_y, darkBrown);
    short int arrayColor[8][8];
    for(int i = 0; i<8; i++)
    {
        for(int j = 0; j<8; j++)
            arrayColor[j][i] =  background[temp_y+i][temp_x+j];
    }
    draw_previous_box(temp_x, temp_y, arrayColor);

    // blue
    prevXPositionsBLUE[prev] = xBLUE;
    prevYPositionsBLUE[prev] = yBLUE;
    temp_x = prevXPositionsBLUE[(prev + 1)%3];
    temp_y = prevYPositionsBLUE[(prev + 1)%3];
	//draw_box(temp_x, temp_y, darkBrown);
    for(int i = 0; i<8; i++)
    {
        for(int j = 0; j<8; j++)
            arrayColor[j][i] =  background[temp_y+i][temp_x+j];
    }
    draw_previous_box(temp_x, temp_y, arrayColor);

    // counter for previous position vector
    if (prev < 2) {
        prev += 1;
    }
    else {
        prev = 0;
    }
    
    // draw players
    draw_box(xRED, yRED, RED);
    draw_box(xBLUE, yBLUE, CYAN);

    // jump height
    checkJump();

    // read keyboard input 
    if (b2 == 0xF0) {
            if (b3 == 0x23) {
                if (dxRED == MOVE_RIGHT)
                    dxRED = prevXDirectionRED;
            }
            if (b3 == 0x1C) {
                if (dxRED == MOVE_LEFT)
                    dxRED = prevXDirectionRED;
            }
            if (b3 == 0x74) {
                if (dxBLUE == MOVE_RIGHT)
                    dxBLUE = prevXDirectionBLUE;
            }
            if (b3 == 0x6B) {
                if (dxBLUE == MOVE_LEFT)
                    dxBLUE = prevXDirectionBLUE;
            }
    }
    else {
        if (b3 == 0x23) {
            if (dxRED != MOVE_RIGHT) {
                prevXDirectionRED = dxRED;
            }
            dxRED = MOVE_RIGHT;
        }
        else if (b3 == 0x1C) {
            if (dxRED != MOVE_LEFT) {
                prevXDirectionRED = dxRED;
            }
            dxRED = MOVE_LEFT;
        }
        else if (b3 == 0x74) {
            if (dxBLUE != MOVE_RIGHT) {
                prevXDirectionBLUE = dxBLUE;
            }
            dxBLUE = MOVE_RIGHT;
        }
        else if (b3 == 0x6B) {
            if (dxBLUE != MOVE_LEFT) {
                prevXDirectionBLUE = dxBLUE;
            }
            dxBLUE = MOVE_LEFT;
        }
    }

    if (!holdLeftRED && !holdRightRED) {
        dxRED = STILL;
    }
    if (!holdLeftBLUE && !holdRightBLUE) {
        dxBLUE = STILL;
    }
    checkCollisionRed();
    checkCollisionBlue();
    return;
}

void plot_pixel(int x, int y, short int line_color)
{
	*(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

short int readPixelColor(int x, int y) {
    short int color = *(short int *)(pixel_buffer_start + (y << 10) + (x << 1));
    return color;
}

