void draw_horizontal_line(int y, int line_color)
{
	for(int i = 0; i < 320; i++) {
		plot_pixel(i, y, line_color);
	}
}

void wait_for_vsync()
{
	volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
	register int status;
	
	*pixel_ctrl_ptr = 1;
	
	status = *(pixel_ctrl_ptr + 3);
	while ((status & 0x01) != 0){
		status = *(pixel_ctrl_ptr + 3);
	}
}

void clear_screen()
{
	for (int x = 0; x < 320; x++){
		for (int y = 0; y < 240; y++){
			*(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = 0x0;
		}
	}
}

void uint8_to_short(const uint8_t* in, short int out[240][320], int rows, int cols) {
    int k = 0;  // index into the input array
	short int out1d[320*240];
    for (int i = 0; i < rows; i++) {
        for (int j = 0; j < cols; j++) {
            out1d[i * cols + j] = (short int)(in[k]) << 8 | in[k+1];
            k += 2;  // move to next 16-bit value in input array
        }
    }
	
	for(int i = 0; i < rows; i++) {
        for(int j = 0; j < cols; j++) {
            out[i][j] = out1d[i*cols+j];
        }
    }
}

